function ItemCard(props) {
  return (
    <div>
      <img src="./shirtIcon.png" alt="itemIcon" />
      {props.name}
      <br />
      {props.country}
      <br />
      {props.size}
      <br />
      {props.price}
      <br />
    </div>
  );
}

export default ItemCard;
